INSERT INTO `ActionPlan` (`id`, `idForSorting`, `averageThumb`, `chatLog_id`, `chainRoot_id`, `currentAuthorInnovationPoints`, `currentInnoBrokerInnovationPoints`, `discussion`, `headline`, `helpWanted`, `howWillItChangeText`, `howWillItWorkText`, `imagesInstructions`, `lockedBy_id`, `mapInstructions`, `map_id`, `planInstructions`, `powerPlay`, `priceToInvest`, `subTitle`, `sumThumbs`, `talkItOverInstructions`, `title`, `videosInstructions`, `whatIsItText`, `whatWillItTakeText`, `hidden`, `quickAuthorList`, `creationDate`, `createdInMove_id`, `superInteresting`, `revision`)
VALUES
	(1,1,1,1,1,0,0,NULL,NULL,NULL,'This is our chance to show how this impacts our colleagues at the U.S. Department of Defense (DoD).\nWhat elements of the precursor should they focus on?  Will this problem require technology fixes, operational changes, or something else?  Why should the DoD worry about this particular issue?  Don\'t worry about solving the problem, just tell them where to look.','Describe how this concept could have happened.\n\nUnderstanding that there are a number of ways in which these gradual and sudden precursors could have happened, put together a short sequence of events that could have lead to the precursor, and that is believable to the group of authors.','Game.defaultActionPlanImagesText: Photographs, pictures, and charts bring your action plan to life and convey important details that might not fit easily into the text of your plan. \n<p>\nYou can search online for images, or upload images from your own desktop. Be sure to add a caption that explains the significance of each image.\n</p>\n<i>Hint: You may want to give one of your team members the responsibility for tracking down the images that support your plan.</i>\n',NULL,'You can annotate a map to show how your plan would work. Here are some ways to use the map:\n<ul>\n<li>Annotate it with numbered steps to show how your plan will unfold.</li>\n\n<li>Mark the locations of resources your plan will draw on--or put in place.</li>\n\n<li>Add data points that explain the what\'s happening on the ground.</li>\n</ul>\nMaps are powerful tools for planning. Use yours in the way that best supports your plan!\n</p>\n<p>\nAs an author, you may make changes to this map by re-centering, zooming and adding markers.\nSave your changes using one or both of the save buttons above the map before leaving this page. (Non authors do not see the buttons.)\n</p>\n<b>New markers (authors only)</b>:  drag one of the following icons onto the map.  To delete a marker, click it on the map and follow directions in the popup window.\n</p>\n',NULL,'Describe your action plan here. Talk it over with your fellow authors in real-time or asynchronous chat. Add images, videos, or map annotations. Remember this is a team effort! So work with your teammates to come up with the best possible plan.\n<p>\nNeed more information? Check our <a href=\"https://portal.mmowgli.nps.edu/instructions/-/asset_publisher/e02P/content/how-to-build-action-plans\" target=\"_portal\">help</a> page.\n</p>\n<p>\n<b>The 5 Basic Steps:</b>\n<ol>\n<li>Start by entering a headline that captures the big idea.</li>\n\n<li>Describe the basic plan in the What Is It? box.</li>\n\n<li>Make a list of the resources you need in the What Will It Take? box.</li>\n\n<li>Outline the steps to succeed in the How Will It Work box. <i>Hint: Use your card chain as a starting place</i>.</li>\n\n<li>Sum up the impact in the last box, How Will Change the Situation?</li>\n</ol>\nClick Save Changes often to make sure your text is saved. Click History to review previous versions.\n</p><p>\nWork fast. Work smart. Work together.\n<b><i>Good luck!</i></b></p>\n',00000000,200,'First declare who the effected organizations might be, and what their relevant motivations are.\n\nWho is affected by this plan? Why should someone care about it?',0,'Game.defaultActionPlanTalkText: Coming up with an action plan -- with people you may not know across multiple time zones -- can be a challenge. But you can use this private* chat room to trade ideas in real time or leave messages for your teammates.\n<p>\nYou might want to start by discussing the basic ideas in your card chain. How are you going to make those ideas work?  What\'s the core idea?  And what are the actions you need to take? \n</p><p>\nTalk it over here. But don\'t be shy about just starting to fill in the plan. Switch back and forth between The Plan and this team discussion space as you build your winning action plan.\n</p>\n*<i>Your chats cannot be seen by anyone else in the game other than gamemasters. However, they will be available to analysts for post-game analysis</i>.','PLAYER FAMILIARIZATION.  Action plans describe how to solve game challenges and achieve our motivating goals. This action plan provides example guidance for new players.','A video is worth a thousand words.  Consider:<OL><LI> Making a 1-2 minute video to tell us about your action plan.</LI><LI>Share a video you\'ve found that helps support your action plan.</LI></OL>Add a caption to highlight the point you\'re making.','State your idea and flesh it out. \n\nWhat is the precursor you\'re describing? What are the details? How broad or narrow is its effect?  Is this a gradual or sudden precursor?','Describe what capabilities and resources are needed to accomplish this plan.\n\nWhat physical elements are involved?  Who controls those elements?  Are there items outside human control that are important?',00000000,'SeedCard','2015-04-13 13:00:00',1,00000000,0),
	(2,2,1,2,1,0,0,NULL,NULL,NULL,'Game masters can help people to be more engaged by connecting relevant card chains and similar ideas. This approach supports the creation of action plans to bring larger groups together, and also helps reduce the risk of conversation on critical ideas getting split and lost in the avalanche of cards. Constructive moderation also helps flesh out ideas so that, after the game ends and further analysis occurs, so that ideas deemed to have the best potential can be acted upon and taken to the next step toward implementation. ','Game masters can use the tools at their disposal to communicate with the players, mark cards, invite players to participate in action plans, expand on ideas in the card chains, add glossary items, and generally add value. Players are able to ask questions of trusted individuals. Game masters do not appear on the Leader Board, but they are allowed to play with separate accounts at the same time. Playing in two separate browsers makes it easy to \"keep your hats straight\" and participate via both roles. ','Game.defaultActionPlanImagesText: Photographs, pictures, and charts bring your action plan to life and convey important details that might not fit easily into the text of your plan. \n<p>\nYou can search online for images, or upload images from your own desktop. Be sure to add a caption that explains the significance of each image.\n</p>\n<i>Hint: You may want to give one of your team members the responsibility for tracking down the images that support your plan.</i>\n',NULL,'You can annotate a map to show how your plan would work. Here are some ways to use the map:\n<ul>\n<li>Annotate it with numbered steps to show how your plan will unfold.</li>\n\n<li>Mark the locations of resources your plan will draw on--or put in place.</li>\n\n<li>Add data points that explain the what\'s happening on the ground.</li>\n</ul>\nMaps are powerful tools for planning. Use yours in the way that best supports your plan!\n</p>\n<p>\nAs an author, you may make changes to this map by re-centering, zooming and adding markers.\nSave your changes using one or both of the save buttons above the map before leaving this page. (Non authors do not see the buttons.)\n</p>\n<b>New markers (authors only)</b>:  drag one of the following icons onto the map.  To delete a marker, click it on the map and follow directions in the popup window.\n</p>\n',NULL,'Describe your action plan here. Talk it over with your fellow authors in real-time or asynchronous chat. Add images, videos, or map annotations. Remember this is a team effort! So work with your teammates to come up with the best possible plan.\n<p>\nNeed more information? Check our <a href=\"https://portal.mmowgli.nps.edu/instructions/-/asset_publisher/e02P/content/how-to-build-action-plans\" target=\"_portal\">help</a> page.\n</p>\n<p>\n<b>The 5 Basic Steps:</b>\n<ol>\n<li>Start by entering a headline that captures the big idea.</li>\n\n<li>Describe the basic plan in the What Is It? box.</li>\n\n<li>Make a list of the resources you need in the What Will It Take? box.</li>\n\n<li>Outline the steps to succeed in the How Will It Work box. <i>Hint: Use your card chain as a starting place</i>.</li>\n\n<li>Sum up the impact in the last box, How Will Change the Situation?</li>\n</ol>\nClick Save Changes often to make sure your text is saved. Click History to review previous versions.\n</p><p>\nWork fast. Work smart. Work together.\n<b><i>Good luck!</i></b></p>\n',00000000,200,'This plan involves all game masters. It also provides helpful information for players, letting them know how it all WORKS.',0,'Game.defaultActionPlanTalkText: Coming up with an action plan -- with people you may not know across multiple time zones -- can be a challenge. But you can use this private* chat room to trade ideas in real time or leave messages for your teammates.\n<p>\nYou might want to start by discussing the basic ideas in your card chain. How are you going to make those ideas work?  What\'s the core idea?  And what are the actions you need to take? \n</p><p>\nTalk it over here. But don\'t be shy about just starting to fill in the plan. Switch back and forth between The Plan and this team discussion space as you build your winning action plan.\n</p>\n*<i>Your chats cannot be seen by anyone else in the game other than gamemasters. However, they will be available to analysts for post-game analysis</i>.','PLAYER FAMILIARIZATION.  How can game masters best moderate to help players engage, learn and contribute in the game?','A video is worth a thousand words.  Consider:<OL><LI> Making a 1-2 minute video to tell us about your action plan.</LI><LI>Share a video you\'ve found that helps support your action plan.</LI></OL>Add a caption to highlight the point you\'re making.','The Game Master Guidance document is now available on the (controlled access) Game Masters Portal. It involves game masters coaching, encouraging, and supporting player efforts. Hopefully the game quickly becomes clear enough so that players can simply play without lots of explanation. Available to game masters at https://portal.mmowgli.nps.edu/web/portal/gamemaster-guidance','It takes collaboration from multiple disciplines and multiple players. It takes game masters reading cards, marking very interesting ideas, and inviting players to do action plans. It involves asking question about the details of the action plans. A \"light touch\" let\'s player voices be heard without filtering or topspin. Game masters can also play as players to be a catalyst for discussion/thought without the potential to intimidate other players by using the gm_name title with its implied authority.',00000000,'SeedCard','2015-04-13 13:00:00',1,00000000,0);

