VALUES
	(1,NULL,NULL,NULL,NULL,NULL,'Phase 1 Call-to-action briefing summary goes here.','<p>\nPhase 1 (PREPARE) Call-to-action briefing text with HTML tags goes here.</p> \n\nThe <a href=\"http://portal.mmowgli.nps.edu/\" target=\"_blank\">mmowgli portal</a> is another great resource about the game. \n<!-- twitter not working...\n<a align=\"right\" class=\"twitter-follow-button\" data-show-count=\"true\" href=\"https://twitter.com/MMOWGLI\" target=\"_twitter\">Follow&nbsp;@MMOWGLI</a><script>!function(d,s,id){var js,fjs=d.getElementsByTagName(s)[0],p=/^http:/.test(d.location)?\'http\':\'https\';if(!d.getElementById(id)){js=d.createElement(s);js.id=id;js.src=p+\'://platform.twitter.com/widgets.js\';fjs.parentNode.insertBefore(js,fjs);}}(document, \'script\', \'twitter-wjs\');</script>\n-->\n</p> \n<p> \nThanks for your ideas. \nPlay&nbsp;the&nbsp;game, change the game! \n</p>','PREPARE',NULL,NULL,NULL,'PREPARE phase Orientation call-to-action-text goes here.','<p>\nPhase 1 (PREPARE) phase orientation Headline\n\n</p>\n<p>\nThe <b>new MMOWGLI game</b> starts on <b>1&nbsp;January 2025</b>. To <a href=\"signup\">sign&nbsp;up</a> and receive email notification when the new MMOWGLI starts, please select the \"Tell Me More\" button.\n</p> \n<p> \nThe <a href=\"http://portal.mmowgli.nps.edu/\" target=\"_blank\">portal</a> is a great information resource for game play.  Check out the <a href=\"http://portal.mmowgli.nps.edu/newgame-blog\" target=\"_blank\">new-game&nbsp;blog</a> for the latest game news.\n</p> \n<p>\nYou can also\n<a align=\"right\" class=\"twitter-follow-button\" data-show-count=\"true\" href=\"https://twitter.com/MMOWGLI\" target=\"_twitter\">Follow&nbsp;@MMOWGLI</a> on Twitter to stay informed.\n\n<script>!function(d,s,id){var js,fjs=d.getElementsByTagName(s)[0],p=/^http:/.test(d.location)?\'http\':\'https\';if(!d.getElementById(id)){js=d.createElement(s);js.id=id;js.src=p+\'://platform.twitter.com/widgets.js\';fjs.parentNode.insertBefore(js,fjs);}}(document, \'script\', \'twitter-wjs\');</script>\n</p> \n\n<p> \nPlay&nbsp;the&nbsp;game, change the game! \n</p>','(PREPARE phase orientation summary)','Start now, play fast, work together.','Play the game, change the game!',NULL,423,NULL,424,'MMOWGLI: Massive Multiplayer Online Wargame Leveraging the Internet','<table>\n<tr>\n<td>\n<iframe width=\"420\" height=\"315\" src=\"https://www.youtube.com/embed/fAfRuU78X34\" frameborder=\"0\" allowfullscreen></iframe>\n<p align=\"center\">\n<a href=\"https://portal.mmowgli.nps.edu/game-wiki/-/wiki/PlayerResources/Video%20Resources\">Can\'t see the video?</a></p>\n</td>\n<td> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\n</td>\n<td>\n<p>\n<sample text from past game>Black swan events have rare probability and high impact, making them <b>impossible to predict</b>. Can we <b>anticipate and prepare</b> for the unpredictable? \n</p>\n<p> A black swan is coming... \n starting <b>20&nbsp;January 2015</b>\n</p>\n<p>\n</p>\n<p>\nIf you are willing to be a part of the <b>blackswan Task Force</b>, please fill in your contact information and click \"Signup\" below. By doing so, you will receive your Mission Brief prior to the start of the game.</p>\n\n<p>\nThe game starts soon.\nHow&nbsp;will&nbsp;<i>you</I> rewrite the formula for the future? \n</p>\n\n<p> More information is available on the\n<a href=\"https://portal.mmowgli.nps.edu/blackswan\" target=\"_blank\">blackswan portal</a>\nand\n<a href=\"https://portal.mmowgli.nps.edu/blackswan-blog\" target=\"_blank\">blackswan blog</a>.\nYou can also\n<a align=\"right\" class=\"twitter-follow-button\" data-show-count=\"true\" href=\"https://twitter.com/MMOWGLI\" target=\"_twitter\">follow&nbsp;@MMOWGLI on&nbsp;Twitter</a><script>!function(d,s,id){var js,fjs=d.getElementsByTagName(s)[0],p=/^http:/.test(d.location)?\'http\':\'https\';if(!d.getElementById(id)){js=d.createElement(s);js.id=id;js.src=p+\'://platform.twitter.com/widgets.js\';fjs.parentNode.insertBefore(js,fjs);}}(document, \'script\', \'twitter-wjs\');</script>\nfor regular updates.\n</p>\n<p>\n<img src=\'https://web.mmowgli.nps.edu/mmowMedia/images/blackThumb21w29h.png\' height=\'29\' width=\'21\'/>\nThanks for your interest.\n<br />\n<b>Play the game, change the game!</b>\n</p>\n\n</td>\n</tr>\n</table>',00000001,00000001,00000001,'tellMeMore130w15h.png','Signup for email notification','Permission signup for email notification',00000001,00000001,'imNewButton202w22h.png','Game masters only please...','You can get started in 2 minutes...',00000001,00000001,'imRegisteredButton133w24h.png','Rejoin the action now!','Login using your game name',00000001,00000001,'guestLogin97w24h.png','Look around a bit','Read only',127,00000000,'mmowgli_logo_final.png','Who is involved?','What is it?','What will it take?','How will it work?','How will it change the situation?',0),
